llm_output:
function transfer(address recipient, uint256 amount) public returns (bool) {
    address sender = _msgSender();

    /*  -------- Basic sanity checks -------- */
    require(sender != address(0), "ERC20: transfer from the zero address");
    require(recipient != address(0), "ERC20: transfer to the zero address");
    require(amount > 0, "Transfer amount must be greater than zero");

    /*  -------- Anti-bot / transfer-delay logic -------- */
    if (
        transferDelayEnabled &&
        recipient != address(uniswapV2Router) &&
        recipient != uniswapV2Pair
    ) {
        require(
            _holderLastTransferBlock[tx.origin] < block.number,
            "Only one transfer per block allowed."
        );
        _holderLastTransferBlock[tx.origin] = block.number;
    }

    /*  -------- Trading / limits enforcement -------- */
    if (!tradingOpen) {
        // Owner can always add liquidity before trading is officially opened.
        require(
            sender == _owner || recipient == _owner,
            "Trading is not yet enabled."
        );
    }

    if (sender != _owner && recipient != _owner) {
        require(
            amount <= _maxTxAmount,
            "Exceeds the _maxTxAmount."
        );

        if (recipient != uniswapV2Pair) {
            require(
                _balances[recipient] + amount <= _maxWalletSize,
                "Exceeds the _maxWalletSize."
            );
        }
    }

    /*  -------- Determine applicable buy/sell tax -------- */
    uint256 taxRate;
    if (sender == uniswapV2Pair) {
        // Buy
        taxRate = (_buyCount > _reduceBuyTaxAt)
            ? _finalBuyTax
            : _initialBuyTax;
        _buyCount++;
    } else if (recipient == uniswapV2Pair) {
        // Sell
        taxRate = (_buyCount > _reduceSellTaxAt)
            ? _finalSellTax
            : _initialSellTax;
    }

    uint256 taxAmount = (amount * taxRate) / 100;
    uint256 transferAmount = amount - taxAmount;

    /*  -------- Balance bookkeeping -------- */
    _balances[sender]    -= amount;
    _balances[recipient] += transferAmount;

    emit Transfer(sender, recipient, transferAmount);

    /*  -------- Collect tax -------- */
    if (taxAmount > 0) {
        _balances[address(this)] += taxAmount;
        emit Transfer(sender, address(this), taxAmount);
    }

    return true;
}

